('PP 02', '02/01/2020', 'PLANTA POTABILIZADORA BENITO JU?REZ', 'REVISI?N EN AGITADORES DEL M?DULO NO. 1 DE ?REA DE FLOCULADORES DEBIDO A FALLA REPORTADA, SE ENCONTR? DA?O EN SOLDADURA DE TUBO QUE SOPORTA LA BRIDA DEL MECANISMO DE AGITACI?N, PENDIENTE EXTRACCI?N DE AGITADOR HASTA QUE BAJE EL NIVEL DEL C?RCAMO YA QUE EL MECANISMO SE ENCUENTRA ANCLADO AL SUELO.\n\nREVISI?N DE V?LVULA DE AGUA FILTRADA DEL FILTRO NO. 5 YA QUE SE REPORT? QUE NO CONTROLABA EL FLUJO, SE DETECT? COMAL FUERA DE LA GU?A POR LO CUAL NO CONTROLABA, SE INSERT? NUEVAMENTE Y SE DEJ? LISTA PARA OPERACI?N NORMAL.'),
('AP 32', '02/01/2020', 'VILLA FLORIDA ', 'REVISI?N DE EQUIPOS DEBIDO A QUE NO SACABAN AGUA, SE PURGO BOMBA BIPARTIDA DE POSICI?N NO. 2 YA QUE SE REPORT? QUE NO SACABA AGUA.'),
('AR 03', '02/01/2020', 'AYUNTAMIENTO', 'REVISI?N DE BOMBA SUMERGIBLE DE 4.5 HP Y MONITOREO DE NIVELES DEBIDO A DOBLE FALLA EN L?NEAS DE CFE.'),
('PP 01', '03/01/2020', 'PLANTA POTABILIZADORA PASTOR LOZANO +  AP 06 (PETROLERA, JU?REZ) + AP 07 (PONIENTE, GRANJAS)', 'REVISI?N DE EQUIPOS Y MANTENIMIENTO PREVENTIVO A BOMBAS BIPARTIDAS DEL SECTOR PONIENTE, GRANJAS, JU?REZ PONIENTE Y PETROLERA, SE ENGRASARON Y SE REALIZARON AJUSTES REQUERIDOS.'),
('AR 30', '03/01/2020', 'LAS FUENTES, SECCI?N LOMAS ', 'REVISI?N DE BOMBA SUMERGIBLE MARCA FLYGT DE ?REA PLUVIAL POR FALLA REPORTADA, SE DETECT? QUE SE ELEVA AMPERAJE Y SE PROTEGE POSIBLEMENTE POR SOLIDO INCRUSTADO DENTRO DE CARACOL, PENDIENTE EXTRACCI?N CON GR?A PARA SU REVISI?N FUERA DE C?RCAMO.'),
('PP 02', '06/01/2020', 'PLANTA POTABILIZADORA BENITO JU?REZ', 'REVISI?N DE AGITADORES DE MODULO NO. 1 DE ?REA DE FLOCULADORES SE DETECT? QUEBRADOS DE LA BRIDA, EL PROBLEMA FUE QUE SE QUEBR? EL TUBO DEL AGITADOR, SE ELIMIN? 2 TABLAS POR LADO PARA QUE NO HAGA TANTA FUERZA Y SE RECUPERARON LAS BRIDAS CON EQUIPO OXICORTE.\n    \nSE REVISARON V?LVULAS DE AGUA CLARIFICADA EN FILTRO NO. 5 Y 6 DEL M?DULO NO. 2 DEBIDO A QUE COMAL SE ZAFO DE LA GU?A Y PROVOCABA FUGA DE AGUA PARA EL LAVADO DE FILTROS, SE DEJ? EN OPERACI?N NORMAL Y SE REPORT? AL ENCARGADO DE LA PLANTA QUE LA PARRILLA DONDE SE REALIZA LA MANIOBRA DE LA V?LVULA, SE ENCUENTRA MUY DA?ADA Y ESTO PROVOCA EL DA?O DE LAS V?LVULAS DE AGUA CLARIFICADA.'),
('AR 30', '06/01/2020', 'LAS FUENTES, SECCI?N LOMAS ', 'SE EXTRAJO BOMBA SUMERGIBLE MARCA FLYGT DE ?REA PLUVIAL CON GR?A PARA REVISARLA Y SE RETIR? UNA LLANTA QUE ESTABA ATORADA EN EL IMPULSOR LO CUAL PROVOCABA QUE SE ELEVARA EL AMPERAJE Y POR CONSECUENCIA POCO GASTO.'),
('AX', '07/01/2020', 'PLANTA POTABILIZADORA BENITO JU?REZ', 'TRABAJO EN LA PLANTA JU?REZ CON LOS AGITADORES DEL M?DULO NO. 1, SE LES SOLD? LA BRIDA AL TUBO CON SOLDADURA 6011 Y 7018.'),
('PP 01', '07/01/2020', 'PLANTA POTABILIZADORA PASTOR LOZANO +  AP 08 (JARACHINA)', 'CON EQUIPO OXICORTE SE CALENT? TORNILLOS DE ESTOPEROS PARA EXTRAERLOS Y SE CORTARON ESP?RRAGOS PARA PONERLOS NUEVOS EN LA POSICI?N NO. 6 Y PROLONGAR LA VIDA DEL PRENSAESTOPERO Y EVITAR FUGA DE AGUA QUE MOJE ACCIDENTALMENTE AL MOTOR.'),
('AR 22', '07/01/2020', 'PUERTA DEL SOL ', 'REPARACI?N DE V?LVULA CHECK DE 8? DEBIDO A FUGA.\n\nPREPARACI?N Y ADECUACI?N DE TUBER?A PARA MANIOBRA DE INSTALACI?N DE BOMBA SUMERGIBLE.'),
